import React from 'react';
import logo from './logo.svg';
import './App.css';


function App() { 

  const rnd = Math.round(Math.random()*10)
  return (

    <div className="App">
      <header className="App-header">Try to number from 1 to 10!
      <p>This time number is {rnd}</p></header>

      <img src={logo} className="App-logo" alt="logo" />
    </div>

  );
}

export default App;
